//import './App.css';
import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

/////////////////////////////////////////////////////// M-ui
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';

/////////////////////////////////////////////////////// File

/////////////////////////////////////////////////////// Path Component
import Search from './Search'
import Information from './Inofrmation'
import Add from './Add'
import Out from './Out'
import History from './History'


const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    margin: '10px'
  },
  Navbar: {
    padding: theme.spacing(6),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  Footer: {
    padding: theme.spacing(6),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  PaperL: {
    padding: theme.spacing(1),
    height: 600 ,
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  PaperR: {
    padding: theme.spacing(2),
    height: 600 ,
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  Button: {
    '& > *': {
      margin: theme.spacing(1),
      padding: '20px',
      margin: '4px'
    },
  logout: {
    marginTop: '50px',
    position: 'absolute'
  }
  }
}));


function Dasboard() {
  const classes = useStyles();

  return (
    <Router>
      <div className="App">
        <div className={classes.root}>
          <Grid container spacing={3}>
            <Grid item xs={12}>
              <Paper className={classes.Navbar}>
                <h1>Facility Store</h1>
              </Paper>
            </Grid>
            <Grid item xs={3}>
            <Paper className={classes.PaperR}>
              <div className={classes.Button}>
                <Button variant="contained" fullWidth color="Primary" component={Link} to="/Search">
                  Search
                </Button>
                <Button variant="contained" fullWidth color="Primary" component={Link} to="/Information">
                  Information
                </Button>
                <Button variant="contained" fullWidth color="Primary" component={Link} to="/Add">
                  Register
                </Button>
                <Button variant="contained" fullWidth color="Primary" component={Link} to="/History">
                  History
                </Button>
                <div>
                <Button className={classes.logout} variant="contained" fullWidth  component={Link} to="/Login">
                  <h2>Logout</h2>
                </Button>
                </div>
              </div>
            </Paper>
            </Grid>
            <Grid item xs={9}>
              <Paper className={classes.PaperL}>
                  <Switch>
                    <Route path="/Search" >       <Search/>       </Route>
                    <Route path="/Information" >  <Information/>  </Route>
                    <Route path="/Add" >          <Add/>          </Route>
                    <Route path="/History" >      <History/>      </Route>
                  </Switch>
              </Paper>
            </Grid>
            <Grid item xs={12}>
              <Paper className={classes.Footer}>
                Footer
              </Paper>
            </Grid>
          </Grid>
        </div>
      </div>
    </Router>
  );
}


export default Dasboard;
